description:
This animal welfare series follows the men and women who investigate cases of animal cruelty; rescue sick and abused animals and fight for justice on their behalf. Hundreds of thousands of animals are rescued each year from coast to coast and it is the Animal Cops mission to give hope and create happy endings out of tragic situations. http://animal.discovery.com/tv/animal-cops/


This release contains 92 episodes of folowing Animal Cops series:


    Animal Cops Houston
    Animal Cops Phoenix
    Animal Cops Phoenix (Animal Planet Heroes)
    Animal Cops Philadelphia
    Animal Cops South Africa
    Animal Cops Miami
    Animal Police Miami
    Sottish SPCA (On the Wildside)


Audio 1: Russian
Audio 2: English
Video: Xvid ~1178 Kbps
Source: SATRip

